import { all, fork } from 'redux-saga/effects';

import postSaga from './post';
import userSage from './user';

export default function* rootSaga() {
  yield all([
    fork(watchLogIn), // call과 다름 (call은 비동기 실행)
    fork(watchLogOut),
    fork(watchAddPost),
  ]);
}
